import { Card } from 'antd';
import { Skeleton } from 'antd';

const User = () => {
    return ( 
        <div className="site-card-border-less-wrapper">
            <Card  bordered={false} style={{ width: 300, backgroundColor: '#3A3C41', borderRadius:'20px', color:'white',boxShadow:'0px 0px 10px 10px black' }}>
                <div style={{fontWeight:'bold', fontSize:'20px', color:'#9BA6B2'}}>Total Sessions</div>
                <Skeleton active />
            </Card>

        </div>
     );
}

export default User;
